 promotes phosphorylation of eukaryotic initiation factor 4E (

 in BAEC . DB11320 - stimulated

<div class="entities" style="line-height: 2.5; direction: ltr">Essential erbB family phosphorylation in osteosarcoma as a target for

</mark>
 inhibition . BACKGROUND : The role of erbB tyrosine kinases , especially Her - 2 , in osteosarcoma has engendered intense debate . Some investigators identified an association between low-level Her - 2 expression , compared to none , and poor patient outcome . Others questioned the importance of apparent cytoplasmic expression of Her - 2 , since membranous overexpression is associated with poor outcome in carcinomas . We previously demonstrated that primary osteosarcoma cells express cell-surface 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and examined the phosphorylation status of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533

</mark>
 , Her - 2 , and Her - 4 by immunohistochemistry , cell-based ELISA , flow cytometry and two dimensional Western blot . We also assessed the impact of 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05424

</mark>
 upon osteosarcoma growth and survival in vitro . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , Her - 2 , and Her - 4 were constitutively phosphorylated in early passage osteosarcoma cells cultured in vitro .

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Acute kidney injury and inflammatory immune reconstitution syndrome in mixed genotype ( A / E ) hepatitis B virus co-infection in HIV-associated lymphoma . We report a first case of HIV-associated lymphoma ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) presenting with acute kidney injury ( AKI ) and inflammatory immune reconstitution syndrome ( IRIS ) . A 39 - year-old male , treated with nonsteroidal anti-inflammatory drugs ( NSAIDs ) for one month prior to admission , developed AKI , left testicular tumor , and recurrent swelling of the right parotid gland . A resected testicular tumor exhibited features intermediate between diffuse large B-cell lymphoma and Burkitt lymphoma . Renal biopsy showed hydro-degeneration of renal tubules , interstitial inflammatory cells , and a small number of lymphoma cells in the sub-capsule , compatible with acute interstitial nephritis . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00117
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 renal dysfunction rapidly recovered following chemotherapy and combination antiretroviral therapy ( cART ) . He developed pneumonia concomitantly with a decrease in HIV-RNA level and an increase in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01730

</mark>
 + cells after the first cycle of chemotherapy , which spontaneously resolved after the second cycle of chemotherapy without additional anti-infection drugs ; thus , his pneumonia fulfilled the diagnostic criteria for IRIS . We suggest that IRIS may frequently develop during chemotherapy for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42357
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 , but may be overlooked . He was coinfected with hepatitis B virus ( HBV ) , which genotypes known as is associated with liver-related mortality and response to antiviral therapy ; recently , an intimate interplay between HIV and HBV in the onset of lymphoma has been reported . Therefore , we addressed the HBV genotype in the patient . The analysis revealed that he exhibited a mixed genotype ( A / E ) not native to Japan and primarily found in Europe and North America or West Africa . These findings suggest that universal vaccination for juveniles against HBV is warranted in Japan .</div>

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Cbl-b is a negative regulator of inflammatory cytokines produced by IgE-activated mast cells . c-Cbl and Cbl-b E3 ubiquitin ligases are abundantly expressed in hemopoietic cells where they negatively regulate the activity and levels of many cell surface receptors and associated signaling molecules . By comparing bone marrow-derived mast cells from c-Cbl and Cbl-b-deficient mice it has recently been shown that Cbl-b is the dominant family member for negatively regulating signaling responses from high-affinity IgE receptors . In this study , we suggest that a possible reason for the greater enhancement of IgE receptor signaling in Cbl-b-deficient mice is the relatively higher levels of Cbl-b protein over c-Cbl in mast cells compared with other hemopoietic cells . We also directly compare mast cells from c-Cbl and Cbl-b-deficient mice and find that loss of Cbl-b , but not c-Cbl , increases cell growth , retards receptor internalization , and causes the sustained tyrosine phosphorylation of Syk and its substrates . However , loss of Cbl-b does not enhance the activation of
